Git Source Inherits: AccumulatorBase Author: StakeDAO Abstract contract for distributing ERC20 rewards over a fixed number of weekly steps, each step making an equal share of the available balance claimable. Designed for gas efficiency, modularity, and predictable reward flows. Distributes rewards in equal weekly steps (aligned to EVM week boundaries). Distribution state is packed for gas efficiency. New distribution can only start when the previous is over and balance is nonzero. At each step, claimable reward = current balance / remaining steps. Missed steps are not compounded; distribution resumes at the next eligible call. Additional tokens sent during an active distribution are included in future steps. No overlapping distributions; last step drains remaining balance. Inheriting contract must call advanceDistributionStep() after distributing. Example usage: function claimReward() external {
uint256 reward = calculateDistributableReward();
require(reward > 0, "No reward available");
_sendReward(msg.sender, reward);
advanceDistributionStep();
}
```* **Note:**
contact: contact@stakedao.org ## State Variables
### PERIOD_LENGTH
--- IMMUTABLES A fixed-length interval defining by how many active weeks the reward is dripped equally. ```solidity
uint256 public immutable PERIOD_LENGTH;
